  const [petArr,setPetArr] = useState() 
  const URL = "http://localhost:4000/pet/get";
  axios
    .get(URL)
    .then((response) => {
      const { data } = response;
      console.log(data);
      setPetArr(data)
      console.log(petArr)
    })
    .catch((err) => console.log(err.response));
  return (
    <>
      <Header />
      <Input>

      </Input>
      <Footer />
    </>
  );
}
